import { useState } from "react"

function useStats() {
    const [stats, useStats] = useState()
    useEffect(() => {
        async function fetchData() {
            console.log('fatching data');
            fetch('https://covid19.mathdro.id/api').then(data => data.json())
        }
        fetchData()
    }, [])
}

export default function Index() {
    return <h1>Hello</h1>
}
